import React, { useEffect, useState } from 'react'
import styled from 'styled-components'
import { NavLink } from 'react-router-dom'

import house from '../Images/house.png'

const Me: React.FC = () =>{
    const [myAge, setMyAge] = useState(0)
    useEffect(() => {

      }, [setMyAge])

    const countDown = new Date("Sep 13 1994 12:18:27").getTime();
    var x = setInterval(function () {
      var now = new Date().getTime();
      var distance = now - countDown;
      var days = Math.floor(distance / (1000 * 60 * 60 * 24));
      var hours = Math.floor((distance % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60));
      var minutes = Math.floor((distance % (1000 * 60 * 60)) / (1000 * 60));
      var seconds = Math.floor((distance % (1000 * 60)) / 1000);
      var milliseconds = distance % 1000;
      var paddedHours = hours < 10 ? `0${hours}` : hours;
      var paddedMinutes = minutes < 10 ? `0${minutes}` : minutes;
	  var paddedSeconds = seconds < 10 ? `0${seconds}` : seconds;
      document.getElementById("countDown").innerText = distance/31536000000 
		// `${days}:${paddedHours}:${paddedMinutes}:${paddedSeconds}:${milliseconds}`;
    }, 1000);
    return(
        <StyledContainer>
            <StyledSectionsHolder>
            <StyledSections to='/' exact><img width="30px" height="30px" src={house} alt='house to show that this is a button to home'/></StyledSections>
            </StyledSectionsHolder>
            <StyledHeader>About me</StyledHeader>
        </StyledContainer>
    )
}

const StyledHeader = styled.h3`
    text-align: center;
`

const StyledSections = styled(NavLink)`
    height: 10%;
    width: 10%;
    padding:2%;
`

const StyledContainer = styled.div`
display: flex;
flex-flow: column;
margin-left: auto;
margin-right: auto;
border-radius: 4px;
justify-content: center;
width: 80%;
height: 90%;
background-color: #008B8B;
`
const StyledSectionsHolder = styled.nav`
@media (min-width: 900px){
        position: absolute;
    color:unset;
    text-decoration: none;
    top: 3%;
    height: 15%;
    width: 15%;
    display: flex;
        left: 3%;
    }
    @media (max-width: 900px){
        position: absolute;
    color:unset;
    text-decoration: none;
    top: 3%;
    height: 15%;
    width: 15%;
    display: flex;
        left: 2%;
    }
`

export default Me;
